INSERT INTO `recept` VALUES (5,'Grcka salata','Sitno iseci krastavac i papriku. Luk iseci na tanke kolutove, pa ih razdvojiti. Sir iseci na sitne kockice. Dodati paradajzice, kapare i masline. Posoliti i pobiberiti po ukusu. Preliti sokom od limuna i maslinovim uljem i lagano izmesati.','2020-01-25',1,2),(6,'Mimoza salata','Skuvati krompir u ljusci, ohladiti ga i oljustiti. Jaja skuvati, ohladiti i oljustiti. Napraviti preliv za salatu, mesanjem pavlake i majoneza. Posoliti ga i zaciniti po ukusu. Svi sastojci se rendaju i slazu u slojevima u ciniju. Dno cinije premazati slojem preliva od majoneza i pavlake. Izrendati krompir, posoliti, preko njega staviti sloj preliva. Izrendati sunku i premazati prelivom u tankom sloju. Izrendati kuvano jaje, posoliti, a zatim staviti preliv. Preko se renda kackavalj. Jos jednom sloziti sastojke istim redosledom. Odozgo narendati malo vise kackavalja.','2020-01-25',1,2),(7,'Salata od jaja','Napunite dublju serpu vodom i kad prokljuca, spustajte jaja jedno po jedno u vrelu vodu i zatim smanjite temperaturu da voda samo struji. Poklopite i ostavite 10 minuta. Pripremite ciniju punu ledene vode i supljikavom kasikom prebacite jaja iz vrele u hladnu vodu. Tako ce biti spremna za ljustenje. Kolicine prilagodite broju osoba. Oljustena jaja iseckajte, dodajte zacine i dobro izmesajte pa rashladite pre sluzenja. Ova salata je odlicna i kao namaz za sendvic, a atraktivno ce izgledati i servirana u korpicama od listova zelene salate.','2020-01-25',1,3),(8,'Pikantna kikiriki salata','Naseckajte sargarepu na uske tra&#269;ice, pa ubacite u vreli tiganj premazan uljem, zajedno sa kikirikijem. Przite naglo, da se sargarepa kratko karamelizira, pa ostavite da se ohladi. Naseckajte crvenu papriku i glavicu luka, posolite i zacinite sircetom pa ostavite da malo odstoji. Pomesajte papriku i luk sa sargarepom i kikirikijem, prelijte uljem u kojem su se przili pa doterajte ukus po zelji.','2020-01-25',1,3),(9,'Salata od pecuraka','Oprati sampinjone, ocistiti ih i sitno iseckati. Na zagrejanom maslacu proprziti naseckani crni luk. Dodati seckan beli luk i pecurke. Dodati suvi zacin i dinstati dok sva voda ne ispari. Ohladiti, dodati pavlaku i kecap. Dosoliti po potrebi, pobiberiti po ukusu. Ukrasiti po zelji.','2020-01-25',1,1),(10,'Bugarska salata sa sirom','Krastavce operite i iseckajte na kockice. Paradajz operite, isecite na cetvrtine. Operite papriku, izvadite seme, a luk iseckajte na kolutove. U posudu za salatu prvo poslozite krastavce, paradajz, papriku i luk. Dodajte ulje, biber i vinsko sirce. Stavite sos preko salate i lagano promesajte. Sir narendajte (ako koristite fetu, isecite je na kockice). Pospite salatu sirom i liscem mente.','2020-01-25',1,1),(11,'Salata sa rukolom i jagodama','Operote rukolu i ocedite je. Operite jagode, uklonite peteljke i iseckajte ih na cetvrtine. Odrezite piletinu na kriske. Rasporedite rukolu na tanjir. Pokrijte komadima piletine i jagodama. U sos dodajte zacin sa agavinim sirupom ili medom, sircetom i soli. Stavite sos preko salate i pospite gustim mlevenim biberom. Pilece belo meso mozete zameniti drugim pecenim mesom, kao sto je svinjski but ili teletina.','2020-01-25',1,4);
